function compareDate($dt1, $dt2) {
	$date1 = DateTime::createFromFormat("d/m/Y", $dt1);
	$date1 = DateTime::createFromFormat("Y-m-d", $dt1);
	$date2 = DateTime::createFromFormat("d/m/Y", $dt2);
	$date2 = DateTime::createFromFormat("Y-m-d", $dt2);
    return $date1->getTimestamp() - $date2->getTimestamp();
}

