$arrayDateDeliveries = "[";

$lastValuePfizer = 0;
$lastValueModerna = 0;
$lastValueAstra = 0;
$lastValueJanssen = 0;


foreach($deliveriesAllTime as $date => $delivery) {
	//$arrayDateDeliveries .= '"' . DateTime::createFromFormat('d/m/Y', $date)->format('d-m-Y') . '", ';
	$arrayDateDeliveries .= '"' . DateTime::createFromFormat('Y-m-d', $date)->format('d-m-Y') . '", ';
	foreach($delivery as $type => $value) {
		if($type == "Pfizer") {
			$lastValuePfizer += $value;
			array_push($arrayDeliveriesPfizer, intval($lastValuePfizer));
		} 

		if($type == "Moderna") {
			$lastValueModerna += $value;
			array_push($arrayDeliveriesModerna, intval($lastValueModerna));
		}

		if($type == "AstraZeneca") {
			$lastValueAstra += $value;
			array_push($arrayDeliveriesAstra, intval($lastValueAstra));
		}

		if($type == "Janssen") {
			$lastValueJanssen += $value;
			array_push($arrayDeliveriesJanssen, intval($lastValueJanssen));
		}
	}
	$length++;

	if(count($arrayDeliveriesPfizer) < $length) {
		array_push($arrayDeliveriesPfizer, $lastValuePfizer);
	}
	if(count($arrayDeliveriesModerna) < $length) {
		array_push($arrayDeliveriesModerna, $lastValueModerna);
	}
	if(count($arrayDeliveriesAstra) < $length) {
		array_push($arrayDeliveriesAstra, $lastValueAstra);
	}
	if(count($arrayDeliveriesJanssen) < $length) {
		array_push($arrayDeliveriesJanssen, $lastValueJanssen);
	}
}

$arrayDateDeliveries .= "]";
